import styled from "styled-components";

const Line = ({ type, ...props }) => {
  switch (type) {
    case "Vertical":
      return Vertical;
      break;
    case "Horizontal":
      return Horizontal;
      break;
    default:
      return Vertical;
  }
};

const Horizontal = styled.div`
  height: 1px;
  background: black;
  width: 60px;
`;

const Vertical = styled(Horizontal)`
  transform: rotate(90deg);
`;

export default Line;
